class Helado {
    constructor(id, imagen, nombre, enStock) {
      if (this.constructor === Helado) {
        throw new Error("FYI: Instance of Abstract class cannot be instantiated");
      }
      this.id = id;
      this.imagen = imagen;
      this.nombre = nombre;
      this.enStock = enStock;
    }
}

export default Helado;
